ive DeLuce Fine Arts Building, Charles Johnson Theater -- Auditorium\n", "J.W. Jones Student Union, 2nd floor, Living Room\n800 University Dr., Maryville, MO\n", "", "Valk Center, Room 118\n", "Carl and Cheryl Hughes Fieldhouse\n", "Ron Houston Center for the Performing Arts, Mary Linn Auditorium\n", "", "J.W. Jones Student Union, Ballroom, Boardroom, First Ladies Dining Room\n", "Hays, KS\n", "Olive DeLuce Fine Arts Building, Charles Johnson Theater -- Auditorium\n", "Missouri Southern State University\nJoplin, MO\n", "", "Hays, KS\n", "Olive DeLuce Fine Arts Building, Charles Johnson Theater -- Auditorium\n", "", "", "", "Horace Mann Laboratory School\n", "", "", "", "Horace Mann Laboratory School\n", "", "", "Horace Mann Laboratory School\n", "", "", "Horace Mann Laboratory School\n", "", "", "Horace Mann Laboratory School\n", "", "", "Lamkin Activity Center, Bearcat Arena\n", "", "", ""], "Description": ["Wednesday, November 30, 2022\nTo recognize Native American and Indigenous peoples, the original inhabitants of what is now the United States. It has been honored since 1990, when President George H.W. Bush signed a joint resolution acknowledging the month.\nContact Info\nOffice of Diversity and Inclusion\ndiversity@nwmissouri.edu\n", "Thursday, November 10, 2022 @ 2:00 pm\nThe rise and fall of Missouri\'s Black business districts\nContact Info\nOffice of Diversity and Inclusion\ndiversity@nwmissouri.edu\n", "This Discover Your Major Visit Day is for students who are interested in Northwest and wish to learn more about areas in Business. Majors of interest may include: Marketing/Management, International Business, Accounting, Economics, and Finance. The day includes interacting with current Northwest faculty and students.. The event will highlight Northwest with a campus tour and information sessions.\nTo learn more about the event, please visit the below link:\nhttps://www.nwmissouri.edu/admissions/campusvisits/events/businessFA2.htm\nContact Info\nKristin Little\nkristinl@nwmissouri.edu\n(660) 562-1587\n", "Come learn more about studying abroad and get some free merchandise!\nContact Info\nStudy Abroad Office\nstudyab@nwmissouri.edu\n(660) 562-1015\n", "Northwest is joining colleges and universities throughout the country to celebrate the success of first-generation students and employees.\nThe event, which is free and open to the public, is 2 to 4 p.m. in the J.W. Jones Student Union Living Room. Snacks and beverages will be provided. Attendees will have chances to win gift baskets, a Nintendo Switch and a $250 scholarship.\n", "Labor-contract grading coupled with gameful pedagogy (which is different than gamification) puts the student in the driver’s seat of their success. They choose what assignments they wish to complete for the desired grade outcome, but they do it within the framework of the GradeCraft platform which turns those points into “experience points” like a video game in which they can complete “side missions” for extra points and can earn badges for a wide array of behaviors and activities. Join Dr. Dawn Gilley for an in-person overview and demonstration of this platform.\nContact Info\nLearning & Teaching Center\nLTCITE@nwmissouri.edu\n(660) 562-1532\n", "Wednesday, November 30, 2022\nTo recognize Native American and Indigenous peoples, the original inhabitants of what is now the United States. It has been honored since 1990, when President George H.W. Bush signed a joint resolution acknowledging the month.\nContact Info\nOffice of Diversity and Inclusion\ndiversity@nwmissouri.edu\n", "Thursday, November 10, 2022 @ 2:00 pm\nThe rise and fall of Missouri\'s Black business districts\nContact Info\nOffice of Diversity and Inclusion\ndiversity@nwmissouri.edu\n", "This Discover Your Major Visit Day is for students who are interested in Northwest and wish to learn more about areas in the School of Computer Science and Information Systems. Majors of interest may include Business Education, Business Technology, Computer Science, Cybersecurity, Data Sciences, Digital Media and Management Information Systems. The day includes interacting with current Northwest faculty and students. This event will highlight Northwest with a computer tour and information sessions.\nTo learn more about the event, please visit the below link:\nhttps://www.nwmissouri.edu/admissions/campusvisits/events/computingFA.htm\nContact Info\nKristin Little\nkristinl@nwmissouri.edu\n(660) 562-1587\n", "Career Services is excited to bring Jeff La Montia, Job Development Coordinator/Supervisor for the State of Missouri, Rehabilitation Services for the Blind to campus. He is responsible for working with and helping find jobs for people with visual impairments. He will share his own story as well as demonstrate some of the technologies that allow people with visual impairments to be successful in the workplace. This event is open to all Northwest faculty, staff, and students.\nContact Info\nCareer Services\ncareer@nwmissouri.edu\n(660) 562-1250\n", "Contact Info\nAnthony Olson\naolson@nwmissouri.edu\n(660) 562-1318\n", "The Office of Diversity and Inclusion offers this series of discussions about current events to raise awareness and provide continued dialogue focused on race, the intersectionality of identities, the importance of language, cultural empowerment and social justice, among other topics.\nContact Info\nBrittany Morgan-Roberts\ndiversity@nwmissouri.edu\n(660) 562-1584\n", "Contact Info\nAnthony Olson\naolson@nwmissouri.edu\n(660) 562-1318\n", "Join the Office of Diversity and Inclusion for a movie and discussion night as part of Native American Heritage Month activities.\nThe movie, “Te Ata,” is based on the true story of Mary Thompson Fisher, known as “Te Ata,” who overcame cultural barriers to become an actress and Native American storyteller.\nContact Info\nBrittany Morgan-Roberts\nbroberts@nwmissouri.edu\n(660) 853-1854\n", "Spikeball at Hughes Fieldhouse. Register on IMLeagues by 11/6. Follow us on social media @NWCampusRec\nContact Info\nCampus Recreation\ncrec@nwmissouri.edu\n(660) 562-1606\n", "Wednesday, November 30, 2022\nTo recognize Native American and Indigenous peoples, the original inhabitants of what is now the United States. It has been honored since 1990, when President George H.W. Bush signed a joint resolution acknowledging the month.\nContact Info\nOffice of Diversity and Inclusion\ndiversity@nwmissouri.edu\n", "Thursday, November 10, 2022 @ 2:00 pm\nThe rise and fall of Missouri\'s Black business districts\nContact Info\nOffice of Diversity and Inclusion\ndiversity@nwmissouri.edu\n", "Explore majors in Agriculture, which includes interacting with current Northwest faculty and students. The event will highlight Northwest with a campus tour and information sessions. Students will learn how the School of Agricultural Sciences can further their career goals and have a chance to explore their major in depth.\nTo learn more about the event, please visit the below link:\nhttps://www.nwmissouri.edu/admissions/campusvisits/events/agFA3.htm\nContact Info\nKristin Little\nkristinl@nwmissouri.edu\n(660) 562-1587\n", "Michele Burch Reid, principal with Legacy Consulting Institute and an organizational effectiveness and personal development consultant, presents this session for students and employees. The session is two hours and 30 minutes and counts for two Career Pathing credits.\nAttendees will receive a guide to understanding personality type to improve communication, relationships and peak performance. Burch Reid helps individuals to discover their natural strengths, triggers, communication style, preferred work environments and more.\nNorthwest Career Pathing provides professional development opportunities for faculty and staff while giving participating student employees opportunities to develop skills for the workforce and earn pay increases for their attendance.\nContact Info\nPaula McLain\npmclain@nwmissouri.edu\n(660) 562-1140\n", "Learn about studying abroad by attending a peer-to-peer student panel that will include fun presentations, a Kahoot, Q&A, and free snacks.\nAsk questions about what it is like to study abroad and questions about a particular country or university.\nContact Info\nStudy Abroad Office\nstudyab@nwmissouri.edu\n(660) 562-1367\n", "Dr. Tina Ellsworth, an assistant professor of professional education in Northwest’s School of Education, will present this year’s “Last Lecture,” titled “The Time is Now.” The lecture is free and open to the public.\nSponsored by Northwest\'s Society of President’s Scholars, the annual event gives a Northwest faculty member the opportunity to speak as they would during the last lecture of their careers.\nEllsworth joined the Northwest faculty in 2021. Previously, she taught middle and high school social studies in addition to working as an economic education specialist for the Federal Reserve Bank of Kansas City and a K-12 social studies coordinator for Olathe (Kansas) Public Schools. She has a Ph.D. in social studies education from the University of Kansas and a master’s degree in history as well as a bachelor’s degree in social studies education from the University of Central Missouri. At Northwest, she teaches undergraduate and graduate coursework related to curriculum, multiculturalism, social studies and change management.\nContact Info\nEthan M. Shutts\ns543345@nwmissouri.edu\n", "The Student Activities Council continues its fall lecture series with The Asia Project. The event begins at 7 p.m. in the Charles Johnson Theater; it is free and open to the public.\nSince 2009, The Asia Project has toured more than 2,000 colleges with an acoustic music poetry act that has amazes audiences throughout the country. On the microphone is Asia Samson, a writer, poet and part-time ninja. Accompanying him on the guitar is his brother-in-law, Jollan Aurelio, who uses music to create an atmosphere that brings poetry to emotional levels you would never expect.\nFor more information, visit www.theasiaproject.com.\nContact Info\nIsabelle Stewart\nIstewart@nwmissouri.edu\n(660) 562-1496\n", "Northwest presents William Shakespeare’s “Much Ado About Nothing,” Nov. 10-13 in the Studio Theatre at the Ron Houston Center for the Performing Arts.\nThe comedy focuses on a couple who has had a falling out in the past and communicates in sarcastic verbal jabs and insults. The play brings the 16th century story to the 1920s through set design, costumes and music.\nShowtimes are 7:30 p.m. Nov. 10-12 and 2 p.m. Nov. 13. Tickets are $12 with cash or check only and may be reserved by phone at 660.562.1321 or at the box office beginning one hour before the show time.\nContact Info\nTheatre Northwest\ntheatre@nwmissouri.edu\n(660) 562-1321\n", "Wednesday, November 30, 2022\nTo recognize Native American and Indigenous peoples, the original inhabitants of what is now the United States. It has been honored since 1990, when President George H.W. Bush signed a joint resolution acknowledging the month.\nContact Info\nOffice of Diversity and Inclusion\ndiversity@nwmissouri.edu\n", "Contact Info\nRyan Milke\nrmilke@nwmissouri.edu\n(660) 562-1581\n", "Northwest along with the Show-Me-Gold program, Missouri Army National Guard and the Student Veteran Association will commemorate Veterans Day with military exhibits and activities from 7 a.m. to 10 a.m. at the Carl and Cheryl Hughes Fieldhouse.\nThe come-and-go event will feature various stations set up for attendees to visit. The stations will include a rucksack march, push-up and pull-up competitions, sled relays, soldier attire, cards of gratitude, Americana temporary tattoos and military vehicles. There will also be free hot coffee for veterans.\nThe event is free and open to the public.\nContact Info\nKaley Coulter\nkcoulter@nwmissouri.edu\n(660) 562-1143\n", "If you are a transfer student considering attending Northwest, this day is for you. During the visit, you will have the opportunity to interact with other potential transfer students, as well as learn more about Northwest’s transfer process and admissions requirements. Other key elements include: a campus tour, academic session and lunch.\nTo learn more, visit:\nhttps://www.nwmissouri.edu/admissions/campusvisits/transfer.htm\nContact Info\nKristin Little\nkristinl@nwmissouri.edu\n(660) 562-1587\n", "Northwest presents William Shakespeare’s “Much Ado About Nothing,” Nov. 10-13 in the Studio Theatre at the Ron Houston Center for the Performing Arts.\nThe comedy focuses on a couple who has had a falling out in the past and communicates in sarcastic verbal jabs and insults. The play brings the 16th-century story to the 1920s through set design, costumes and music.\nShowtimes are 7:30 p.m. Nov. 10-12 and 2 p.m. Nov. 13. Tickets are $12 with cash or check only and may be reserved by phone at 660.562.1321 or at the box office beginning one hour before the show time.\nContact Info\nTheatre Northwest\ntheatre@nwmissouri.edu\n(660) 562-1321\n", "Contact Info\nRyan Milke\nrmilke@nwmissouri.edu\n(660) 562-1581\n", "Wednesday, November 30, 2022\nTo recognize Native American and Indigenous peoples, the original inhabitants of what is now the United States. It has been honored since 1990, when President George H.W. Bush signed a joint resolution acknowledging the month.\nContact Info\nOffice of Diversity and Inclusion\ndiversity@nwmissouri.edu\n", "Contact Info\nRyan Milke\nrmilke@nwmissouri.edu\n(660) 562-1581\n", "The 90-minute walking group tour is led by a Northwest student ambassador who will share his or her individual experiences about Northwest and some pointers for selecting a university. The average campus tour is a two-mile walk. If you are unable to walk for this distance please let us know when scheduling the tour and special arrangements can be made.\nAn Admissions Overview will begin at 10:15 a.m. Saturday tours begin at 11:00 a.m. The day will include a Northwest welcome with information about the services we offer and a walking tour of campus.\nTo learn more, please visit the below link:\nhttps://www.nwmissouri.edu/admissions/campusvisits/saturday.htm\nContact Info\nKristin Little\nkristinl@nwmissouri.edu\n(660) 562-1587\n", "The Youth Chorus will join the Tower Choir at 4 p.m. for a concert that is free and open to the public.\nWith its mission of teaching, inspiring and empowering young singers to be lifelong music makers, the Youth Chorus offers singers in grades 3-12 the opportunity to pursue excellence through performance, build skills and experience, and become leaders in their respective schools.\nTower Choir is an award-winning choral ensemble, consistently invited to state conferences, including the Missouri Music Educators Association in 2010, 2013, 2015 and 2020 and the Nebraska Music Educators Association in 2011, 2014 and 2017, as well as by the National Collegiate Choral Organization in 2011. The ensemble performs concerts for high schools, colleges, universities, churches, institutions and organizations throughout the region.\n", "Northwest presents William Shakespeare’s “Much Ado About Nothing,” Nov. 10-13 in the Studio Theatre at the Ron Houston Center for the Performing Arts.\nThe comedy focuses on a couple who has had a falling out in the past and communicates in sarcastic verbal jabs and insults. The play brings the 16th-century story to the 1920s through set design, costumes and music.\nShowtimes are 7:30 p.m. Nov. 10-12 and 2 p.m. Nov. 13. Tickets are $12 with cash or check only and may be reserved by phone at 660.562.1321 or at the box office beginning one hour before the show time.\nContact Info\nTheatre Northwest\ntheatre@nwmissouri.edu\n(660) 562-1321\n", "Wednesday, November 30, 2022\nTo recognize Native American and Indigenous peoples, the original inhabitants of what is now the United States. It has been honored since 1990, when President George H.W. Bush signed a joint resolution acknowledging the month.\nContact Info\nOffice of Diversity and Inclusion\ndiversity@nwmissouri.edu\n", "Northwest presents William Shakespeare’s “Much Ado About Nothing,” Nov. 10-13 in the Studio Theatre at the Ron Houston Center for the Performing Arts.\nThe comedy focuses on a couple who has had a falling out in the past and communicates in sarcastic verbal jabs and insults. The play brings the 16th-century story to the 1920s through set design, costumes and music.\nShowtimes are 7:30 p.m. Nov. 10-12 and 2 p.m. Nov. 13. Tickets are $12 with cash or check only and may be reserved by phone at 660.562.1321 or at the box office beginning one hour before the show time.\nContact Info\nTheatre Northwest\ntheatre@nwmissouri.edu\n(660) 562-1321\n", "The University Chorale and the Tower Choir will perform at 4 p.m. The concert is free and open to the public.\nThe University Chorale is a large choral organization open to all students at Northwest. The Chorale presents a concert each semester, and its repertoire ranges from classical to gospel, and contemporary to Broadway. There is no audition requirement for membership in the University Chorale.\nTower Choir is an award-winning choral ensemble, consistently invited to state conferences, including the Missouri Music Educators Association in 2010, 2013, 2015 and 2020 and the Nebraska Music Educators Association in 2011, 2014 and 2017, as well as by the National Collegiate Choral Organization in 2011. The ensemble performs concerts for high schools, colleges, universities, churches, institutions and organizations throughout the region.\n", "Wednesday, November 30, 2022\nTo recognize Native American and Indigenous peoples, the original inhabitants of what is now the United States. It has been honored since 1990, when President George H.W. Bush signed a joint resolution acknowledging the month.\nContact Info\nOffice of Diversity and Inclusion\ndiversity@nwmissouri.edu\n", "Career Services presents this session for students. Sessions are 60 minutes and begin at 10 a.m. and 2 p.m. in the Student Union Tower View Room.\nFinding your first full-time job can be stressful, but what if it didn’t have to be? Career Services and a special guest employer will discuss how to make recruiters notice you, how to navigate career and networking events, and what they look for when recruiting talent.\nNorthwest Career Pathing provides professional development opportunities for faculty and staff while giving participating student employees opportunities to develop skills for the workforce and earn pay increases for their attendance.\nContact Info\nPaula McLain\npmclain@nwmissouri.edu\n(660) 562-1140\n", "Students who have already enrolled in a payment plan must pay their installment by November 15 in order to avoid a late fee. Failure to pay this installment could delay a student\'s preregistration.\nhttps://www.nwmissouri.edu/studentaccounts/billing-and-payments.htm\nContact Info\nStudent Account Services\nbursar@nwmissouri.edu\n(660) 562-1583\n", "Wednesday, November 30, 2022\nTo recognize Native American and Indigenous peoples, the original inhabitants of what is now the United States. It has been honored since 1990, when President George H.W. Bush signed a joint resolution acknowledging the month.\nContact Info\nOffice of Diversity and Inclusion\ndiversity@nwmissouri.edu\n", "This Discover Your Major Visit Day is for students who are interested in Northwest and wish to learn more about our esports offerings.\nTo register for the event, please visit the below link:\nhttps://www.nwmissouri.edu/admissions/campusvisits/events/esportsFA2.htm\nContact Info\nKristin Little\nkristinl@nwmissouri.edu\n(660) 562-1587\n", "Bucketball in the Student Recreation Center. Register on IMLeagues by 11/13. Follow us on social media @NWCampusRec\nContact Info\nCampus Recreation\ncrec@nwmissouri.edu\n(660) 562-1606\n", "Northwest Missouri State University’s Concert Band will perform a variety of original works during its fall concert. The concert, which is free and open to the public, begins at 7:30 p.m. in the Charles Johnson Theater at the Olive DeLuce Fine Arts Building. The performance group is under the direction of Dr. William Sutton, a lecturer of music at Northwest.\nThe band will perform a series of pieces, including Hugh Stuart’s “Three Ayres from Gloucester;” Rafael Méndez’s “La Virgen de la Macarena;” Michael Sweeney’s “Legend of Devil’s Lake;” Henry Fillmore’s “The Orange Bowl;” Frank Ticheli’s “Earth Song;” Adrian Sims’ “Beyond Reach” and Tyler Grant’s “Shimmering Joy.”\nAdditionally, Dr. William Richardson, a professor of music at Northwest, will join the band to perform “La Virgen de la Macarena” on trumpet.\nThe Concert Band is the newest instrumental ensemble at Northwest and is open to all University students who play a band instrument. The band performs music from a variety of time periods and styles - from historically significant works to new band compositions. The innovative ensemble presents two full band concerts each semester.\nThe Concert Band, which totals about 30 members consisting of University students and employees, also serves as an opportunity for music education students to conduct a band prior to student teaching, developing their skills and techniques as pre-service teachers. Community members are invited to join Concert Band, which is a non-auditioning ensemble that focuses on building community through music.\nContact Info\nWill Sutton\nwsutton@nwmissouri.edu\n", "Contact Info\nRegistrar\'s Office\nregistrar@nwmissouri.edu\n(660) 562-1151\n", "Wednesday, November 30, 2022\nTo recognize Native American and Indigenous peoples, the original inhabitants of what is now the United States. It has been honored since 1990, when President George H.W. Bush signed a joint resolution acknowledging the month.\nContact Info\nOffice of Diversity and Inclusion\ndiversity@nwmissouri.edu\n", "Contact Info\nRegistrar\'s Office\nregistrar@nwmissouri.edu\n(660) 562-1151\n", "Contact Info\nAnthony Olson\naolson@nwmissouri.edu\n(660) 562-1318\n", "Contact Info\nAnthony Olson\naolson@nwmissouri.edu\n(660) 562-1318\n", "Spoken word, poetry, singing, playing an instrument, or any other talent you want to share. Bearcats are invited to showcase their skills at this intimate and judgement-free evening hosted by Wellness Services and Men\'s Minority Organization.\nContact Info\nMonica Zeigel\nmzeigel@nwmissouri.edu\n(660) 562-1348\n", "Wednesday, November 30, 2022\nTo recognize Native American and Indigenous peoples, the original inhabitants of what is now the United States. It has been honored since 1990, when President George H.W. Bush signed a joint resolution acknowledging the month.\nContact Info\nOffice of Diversity and Inclusion\ndiversity@nwmissouri.edu\n", "The Department of Humanities and Social Sciences presents “Occupy Valk,” a teach-in series exploring topics of political science, geography and history in America. During each session, a panel addresses an issue and its historical context.\nThe remaining fall schedule is as follows:\nNov. 17: What the Actual F@#K? School Violence: A Panel Discussion from the Front Lines\nDec. 1: What Does It All Mean? Living a Meaningful Life: Northwest Emeriti Faculty\nContact Info\nDawn Gilley\ndgilley@nwmissouri.edu\n(660) 562-1839\n", "Northwest students who participate in profession-based learning (PBL) experiences are invited to showcase their work at PBL Palooza. The event highlights students’ internships, field experiences, practicums and research projects.\nThe event is open to the public. Attendees will receive tokens to vote for their favorite poster, and winners will choose from a variety of prizes.\nSchedule for the event:\n6:45 - 7 pm: Check in at the registration table when you arrive. Don\'t forget your poster! Our staff will help you hang it and answer any questions you may have.\n7- 8:30 pm: Event begins and voting opens. Voting will take place with a QR code accessible at the event.\n8:30 pm: Presentations end and voting closes.\n8:30 - 9 pm: Placings are announced and prizes are awarded!\nInterested students can learn more about the event at https://www.nwmissouri.edu/career/events/PBL%20Palooza.htm.\nContact Info\nCareer Services\ncareer@nwmissouri.edu\n(660) 562-1250\n", "Contact Info\nBill Richardson\nbillr@nwmissouri.edu\n(660) 562-1316\n", "Wednesday, November 30, 2022\nTo recognize Native American and Indigenous peoples, the original inhabitants of what is now the United States. It has been honored since 1990, when President George H.W. Bush signed a joint resolution acknowledging the month.\nContact Info\nOffice of Diversity and Inclusion\ndiversity@nwmissouri.edu\n", "Horace Mann and Leet Center families will gather to participate in their annual Thanksgiving luncheon. This is a Horace Mann tradition that dates many years. This special event is held in the JW Jones Union Ballroom and Boardroom. It is a traditional meal of turkey, mashed potatoes, vegetables, rolls, and pumpkin dessert. Families and extended families are invited to attend-reservations are required to accommodate everyone. The cost of the meal for guests will be announced later and can be added to your child’s lunch account. Reservation forms will be sent home and emailed several weeks prior to the event and must be returned by the due date to ensure seating for the event. Special parking and shuttle service is available. Shuttle service lots will be announced closer to the event date.\nContact Info\nLaTessa Ruehter\nlatessa@nwmissouri.edu\n(660) 562-1233\n", "Contact Info\nRyan Milke\nrmilke@nwmissouri.edu\n(660) 562-1581\n", "", "The Northwest cross country teams head to Joplin for the NCAA Central Region Championships.\nContact Info\nRyan Milke\nrmilke@nwmissouri.edu\n", "Wednesday, November 30, 2022\nTo recognize Native American and Indigenous peoples, the original inhabitants of what is now the United States. It has been honored since 1990, when President George H.W. Bush signed a joint resolution acknowled